#select a random word as result
def chooseresult(words):
    result = random.choice(words)
    return result

#search all indices of letter
def indlist(seq, letter):
    start_at = -1
    dups = []
    while True:
        try:
            dup = seq.index(letter,start_at+1)
        except ValueError:
            break
        else:
            dups.append(dup)
            start_at = dup
    return dups

#search for matching characters between input and result
#mark characters with specific colors
#win or loose message
def fitchars(win, row, chars, result, file):
    result2 = list(map(lambda x: x.upper(), result))
    input = chars
    common = list(set(result2).intersection(input))
    for l in common:
        win[l].update(button_color=('lightgreen'))
    badchars = set(chars) - set(common)
    for b in badchars:
        win[b].update(button_color=('Grey'))
    for let in result2:
        dupsres = indlist(result2, let)
        if let in input:
            dupsinp = indlist(input, let)
            commoninds = list(set(dupsinp).intersection(dupsres))
            if len(commoninds) !=0:
                for ind in commoninds:
                    input[ind] = 0
                    result2[ind] = 0
                    win[row,ind].update(button_color=('green'))
                    #dupsres.remove(ind)
                    #dupsinp.remove(ind)
            counter=0
            for ix in dupsinp:
                if ix not in commoninds:
                    counter+=1
                    if counter <= (len(dupsres) - len(commoninds)):
                        win[row,ix].update(button_color=('yellow'))

    if result2 == chars:
        sg.popup('YAY, WIN!')
        new_game = open_window(win)
    elif row == 5 and result != chars:
        sg.popup(f'OH NO! It was: {result}')
        new_game = open_window(win)
    else: 
        row +=1
        new_game = False
    if new_game:
        result, chars, row = start(file)
    return row, chars, result, new_game

#choose if you want to play another round    
def open_window(win):
    layout = [[sg.Text("and now?")],
            [sg.Button('', image_data=again, image_subsample=15, bind_return_key=True, key="new"), sg.Button('', image_data=exitb, image_subsample=15, key='Exit')]]
    window = sg.Window("", layout, modal=True)
    while True:
        event, values = window.read()
        if event == "Exit":
            window.close()
            win.close()
            return False
        if event == sg.WIN_CLOSED:
            window.close()
            return False
        if event == 'new':
            window.close()
            return True

